import React from 'react';
import { Link } from 'react-router-dom';
import content from './content';

const contentlist = () => (
    <>
    <h1>Articles</h1>
    {content.map((article, key) => (
        <Link key= {key} to={'/content/${content.name}'}>
        <h3>{article.title}</h3>
        </Link>
    ))}
    </>
);

export default contentlist;
